import { useState, useGlobal } from 'reactn'

const MusicMakerTop = () => {
  const [currnetInstrument, setCurrnetInstrument ] = useGlobal("currnetInstrument")


  const beepNote = () => {
    setCurrnetInstrument('beep')
  }

  const meowNote = () => {
    setCurrnetInstrument('meow')
  }

  const baseNote = () => {
    setCurrnetInstrument('base')
  }

  const drumNote = () => {
    setCurrnetInstrument('drum')
  }


  return (
    <div className="border-solid border-2 border-sky-500 w-[80rem] h-[5rem] mt-10">
      <p onClick={beepNote}>Robot</p>
      <p onClick={meowNote}>Meow</p>
      <p onClick={baseNote}>Base</p>
      <p onClick={drumNote}>Drum</p>
    </div>
  )
}

export default MusicMakerTop
